 	BUFFER := '' ||
		'' ||
        '' ||
        '' ||
        '' ||
        '' ||
        '' ||
        '' ||
        '' ||
        '' ||
        '' ||
        '' ||
        '' ||
        '';
    DBMS_LOB.writeappend(data,LENGTH(buffer),buffer);
END;
